DROP TABLE IF EXISTS `cms_article`;
CREATE TABLE `cms_article` (
  `Id` bigint(20) NOT NULL COMMENT '唯一编号',
  `TenantId` bigint(20) DEFAULT NULL,
  `ColumnId` bigint(20) NOT NULL DEFAULT '0' COMMENT '栏目Id',
  `Title` varchar(128) NOT NULL COMMENT '文章标题',
  `TitleColor` varchar(64) DEFAULT NULL COMMENT '标题颜色',
  `SubTitle` varchar(128) DEFAULT NULL COMMENT '副标题',
  `Author` varchar(32) DEFAULT NULL COMMENT '作者',
  `Source` varchar(32) DEFAULT NULL COMMENT '来源',
  `Sort` int(11) NOT NULL DEFAULT '0' COMMENT '权重',
  `LinkUrl` varchar(128) DEFAULT NULL COMMENT '外部链接地址',
  `Tag` varchar(64) DEFAULT NULL COMMENT '标签',
  `ImgUrl` varchar(512) DEFAULT NULL COMMENT '宣传图 支持多图',
  `VideoUrl` varchar(512) DEFAULT NULL COMMENT '视频地址',
  `Status` bit(1) NOT NULL DEFAULT b'1' COMMENT '发布状态',
  `KeyWord` varchar(128) DEFAULT NULL COMMENT 'Seo关键字',
  `Summary` varchar(512) DEFAULT NULL COMMENT 'Seo描述',
  `Content` text COMMENT '文章内容',
  `Attr` varchar(20) NOT NULL COMMENT '是否置顶',
  `Hits` int(11) NOT NULL DEFAULT '0' COMMENT '点击量',
  `DayHits` int(11) NOT NULL DEFAULT '0' COMMENT '当日点击量',
  `WeedHits` int(11) NOT NULL DEFAULT '0' COMMENT '星期点击量',
  `MonthHits` int(11) NOT NULL DEFAULT '0' COMMENT '月点击量',
  `LastHitDate` datetime DEFAULT NULL COMMENT '最后点击时间',
  `DeleteTime` datetime DEFAULT NULL COMMENT '删除时间',
  `CreateTime` datetime NOT NULL COMMENT '添加时间',
  `CreateUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `UpdateTime` datetime NOT NULL COMMENT '修改时间',
  `UpdateUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='文章表 ';

