BEGIN;
INSERT INTO `cms_article` VALUES (1651781323255320576, 0, 1506535160127033344, '解读“十四五”职业技能培训规划——有技能 好就业', NULL, NULL, NULL, NULL, 0, NULL, '[\"十四五\"]', NULL, NULL, b'1', '十四五', '十四五', '<p>解读《&ldquo;十四五&rdquo;职业技能培训规划》&mdash;&mdash;<br>有技能 好就业</p>\n<p>近日，由人社部、教育部、发展改革委、财政部等部门研究编制的《&ldquo;十四五&rdquo;职业技能培训规划》（以下简称《规划》）印发并公布。</p>\n<p>在1月7日国新办举行的国务院政策例行吹风会上，人力资源和社会保障部副部长汤涛表示，&ldquo;十四五&rdquo;时期，新的就业增长点和新就业形态不断发展变化，迫切需要劳动者提升人力资本和专业技能。</p>\n<p>政府补贴性培训7500万人次以上</p>\n<p>当前，职业培训面临一些新挑战。汤涛表示，一是技能人才培养不适应产业转型升级和技术进步的要求；二是&ldquo;就业难&rdquo;和&ldquo;招工难&rdquo;两难并存，结构性就业矛盾突出，重点就业群体的就业创业能力与用人单位需求存在差距；三是培训基础能力薄弱，培训供给能力不足，培训的针对性、实效性还需要进一步提高，尊重劳动、尊重技能的社会氛围也有待于进一步优化。</p>\n<p>《规划》提出了&ldquo;十四五&rdquo;时期加强职业技能培训工作的目标、任务和保障措施。到2025年要实现终身职业技能培训制度更加完善，共建共享职业技能培训体系更加健全，创新型、应用型、技能型人才队伍不断发展壮大，职业技能培训服务更加有效等四个主要目标。</p>\n<p>&ldquo;具体目标是组织实施政府补贴性培训达7500万人次以上，其中农民工职业技能培训3000万人次以上；新增取得职业资格证书或职业技能等级证书的人员要达到4000万人次以上，其中能够达到高级技工、技师、高级技师的高技能人才要达到800万人次以上；新增公共实训基地200个。&rdquo;汤涛说。</p>\n<p>完善技能人才职业发展通道</p>\n<p>当前，劳动者不愿当工人，技能成才、技能就业吸引力不足等现象比较突出。为不断壮大创新型、应用型、技能型人才队伍，营造更好的社会氛围，《规划》就完善技能人才职业发展通道提出明确要求。</p>\n<p>人力资源和社会保障部职业能力建设司司长刘康指出，要打破目前的&ldquo;天花板&rdquo;&ldquo;隐形门&rdquo;，形成技能人才的纵向职业技能等级阶梯，探索拓展技能人才&ldquo;新八级&rdquo;职业技能等级制度；在横向上，使技能人才和专技人才等相应人才可以贯通发展。</p>\n<p>刘康介绍，下一步，要提高技能人才的待遇水平，引导企业建立健全符合技能人才特点的工资分配制度；推动企业建立工资正常增长机制，探索技能激励办法。要完善以国家奖励为导向、用人单位奖励为主体的技能人才表彰奖励体系；加大对高技能人才在各级各类表彰当中的倾斜力度；要做好&ldquo;中华技能大奖&rdquo;&ldquo;全国技术能手&rdquo;评选表彰，并给予人才更高待遇。</p>\n<p>高质量推动&ldquo;产训结合&rdquo;</p>\n<p>培训不能唱&ldquo;独角戏&rdquo;，要和产业发展密切结合。《规划》适应产业发展需要，提出高质量推动&ldquo;产训结合&rdquo;，促进产业链和职业技能培训链的有效衔接。</p>\n<p>&ldquo;对企业来说，重在发挥培训主体作用。市场上需要什么样的产品和服务，企业需要什么样的人才和技术，企业最有发言权。&rdquo;国家发展改革委就业收入分配和消费司司长哈增友表示，政府部门要充分尊重企业意愿，帮助企业落实好开展培训的税收优惠政策和相关补贴政策，真正支持企业开展多层次、大规模的岗前培训、在岗培训、稳岗培训和转岗培训。同时，也要支持行业龙头企业、大型企业建立自己的职工培训机构，面向本单位的企业职工，包括产业链中关联度比较高的中小微企业的职工开展培训。</p>\n<p>哈增友表示，有关部门将支持引导一万多所职业院校和技工院校充分发挥自身师资优势，持续提升培训内容与企业需求的契合度，推动产教融合、校企合作真正落地见效。</p>\n<p>&ldquo;我们要大力营造&lsquo;劳动光荣、技能宝贵、创造伟大&rsquo;的社会导向，持续增加职业技能培训投入，切实提高广大技能劳动者的待遇水平，推动更多技能劳动者早日跨入中等收入群体行列。&rdquo;哈增友说。</p>', '[]', 0, 0, 0, 0, NULL, NULL, '2023-04-28 10:52:11', '李四', '2023-04-28 10:51:29', NULL);
COMMIT;

