INSERT INTO `exam_course` VALUES (1547837212773715968, 0, 1, 1547577478409752577, '[\"1540272019071963137\"]', '[\"1540271878395006976\"]', 1547152666575114241, 'Web前端开发之VUE.JS全家桶实战教程', 'http://localhost:5000/upload/knowledge/mp4/2-1222111.mp4', '[]', 'http://localhost:5000/upload/knowledge/jpg/22.jpeg', b'1', 1, NULL, 371, '{\"Praise\":5,\"Tread\":1}', '[1,3]', '', '[]', b'0', '在有HTML CSS JavaScript的基础上，快速上手。简单小巧的核心，渐进式技术栈，足以应付任何规模的应用。', '<p>易用</p>\n<p>在有HTML CSS JavaScript的基础上，快速上手。</p>\n<p>灵活</p>\n<p>简单小巧的核心，渐进式技术栈，足以应付任何规模的应用。</p>\n<p>性能</p>\n<p>20kb min+gzip 运行大小、超快虚拟 DOM 、最省心的优化。</p>', '2022-07-15 14:55:24', 'Admin', '2022-08-01 09:23:38', 'Admin');
INSERT INTO `exam_course` VALUES (1547838264566747136, 0, 3, 1547577478409752577, '[\"1540272044145512449\"]', '[\"1540271878395006976\"]', 1547152618760048640, 'IT行业职业发展之路', '', '[]', 'http://localhost:5000/upload/knowledge/png/1.png', b'1', 3, NULL, 64, '{\"Praise\":0,\"Tread\":0}', '[1,3]', '', '[{\"Name\":\"学习课件\",\"Url\":\"http://localhost:5000/upload/knowledge/pdf/document.pdf\"}]', b'0', '信息技术（IT即Information Technology）就是感测技术、通信技术、计算机技术和控制技术。也许您不满意这个定义，但这的确是一个又简洁、又具体、又系统、又实用的定义。', '<p>信息技术（IT即Information Technology）就是感测技术、通信技术、计算机技术和控制技术。也许您不满意这个定义，但这的确是一个又简洁、又具体、又系统、又实用的定义。</p>\n<p>感测技术就是获取信息的技术，通信技术就是传递信息的技术，计算机技术就是处理信息的技术，而控制技术就是利用信息的技术。因此这个定义不但给出了信息技术的内容，也明确了信息技术的获取-传递-处理-利用的体系，还摆清了感测、通信、计算机、控制这些概念。比较明确、领域比较清晰、大众比较有感性认识的技术在信息系统中的作用和相互关系。</p>\n<p>感测、通信、计算机和控制这4大技术在信息系统中虽然各司其职，但是从技术要素层次上看，它们又是相互包含、相互交叉、相互融合的。感测、通信、计算机都离不开控制；感测、计算机、控制也都离不开通信；感测、通信、控制更是离不开计算机。</p>\n<p>对人类社会活动一切有用的数据、资料都可以称为信息。</p>\n<p>广义的信息不仅包括企业生产经营活动的信息，还包括国民经济乃至世界经济活动的信息；不仅包括经济信息，还包括科技信息、社会文化信息、生活信息等。</p>\n<p>狭义的信息主要指与企业生产经营活动有关的微观和宏观经济信息。信息手段和信息技术主要是指从事信息处理的电脑系统和从事信息传递的舆论、通讯工具以及相应信息科学理论。因此，信息技术产业是指从事信息的生产、流通和销售信息以及相应信息科学理论。</p>', '2022-07-15 14:59:34', 'Admin', '2022-07-15 15:04:14', 'Admin');
INSERT INTO `exam_course` VALUES (1548951966498033664, 0, 2, 1547577478409752577, '[\"1540272044145512449\"]', '[\"1540271924658180097\"]', 1547152618760048640, '爱与榜样，赋能教育——高校教师信息化教学能力提升系列教学发展', 'http://local.live.jxtvcn.com.cn/live-jxtv/tv_jxtv1.m3u8', '[]', 'http://localhost:5000/upload/knowledge/jpg/live_1.png', b'1', 1, NULL, 39, '{\"Praise\":0,\"Tread\":0}', '[1,3]', '', '[]', b'0', '智慧树高等教育研究院专家 | 智慧树高等教育研究院', '<p>智慧树高等教育研究院专家&nbsp;|&nbsp;智慧树高等教育研究院</p>', '2022-07-18 16:45:02', 'Admin', NULL, NULL);
