INSERT INTO `exam_course` VALUES (1548956510871228419, 0, 2, 1548955262205956097, '[\"1540272044145512449\"]', '[\"1540271878395006976\"]', 1547152666575114241, '创造性思维与创新方法', 'http://local.live.jxtvcn.com.cn/live-jxtv/tv_jxtv1.m3u8', '[]', 'http://localhost:5000/upload/knowledge/jpg/live_4.png', b'1', 1, NULL, 1, '{\"Praise\":0,\"Tread\":0}', '[1,3]', '', '[]', b'0', '创新——方法——创造——思维——实践，《创造性思维与创新方法》给你带来更多的锻炼、全新的思维方式、更多创新的可能！', '<p>创新&mdash;&mdash;方法&mdash;&mdash;创造&mdash;&mdash;思维&mdash;&mdash;实践，《创造性思维与创新方法》给你带来更多的锻炼、全新的思维方式、更多创新的可能！</p>', '2022-07-18 17:03:05', 'Admin', NULL, NULL);
INSERT INTO `exam_course` VALUES (1548957317406527488, 0, 1, 1547577478409752577, '[\"1540272044145512449\"]', '[\"1540271954144137217\"]', 1547152618760048640, '创践——大学生创新创业实务', 'http://localhost:5000/upload/knowledge/mp4/2-1222111.mp4', '[]', 'http://localhost:5000/upload/knowledge/png/video_1.png', b'1', 1, NULL, 41, '{\"Praise\":2,\"Tread\":1}', '[1,3]', '', '[]', b'0', '《创践——大学生创新创业实务》是由中国海洋大学牵头，南开大学、四川大学、厦门大学共同制作，海尔集团、泰有投资参与建设的创新创业普适性课程', '<p>《创践&mdash;&mdash;大学生创新创业实务》是由中国海洋大学牵头，南开大学、四川大学、厦门大学共同制作，海尔集团、泰有投资参与建设的创新创业普适性课程，秉承&ldquo;创践精业 立人笃行&rdquo;的育人理念，引导学生通过创新性实践提升创业精神，开创事业和人生新境界，获评首批国家精品在线开放课程、国家一流课程，在创新创业类慕课中选课高校量和学生数均排名全国第一，入选人社部首届全国创业就业展示交流周&ldquo;十大创业培训项目&rdquo;，是高校唯一入选且被列为全国重点推广项目，双创教育经验被纳入《创业中国》案例集，获评山东省教学成果一等奖。</p>', '2022-07-18 17:06:17', 'Admin', '2022-07-28 10:52:09', 'Admin');
COMMIT;

