INSERT INTO `exam_question` VALUES (1539906066215735296, 0, 1540272019071963137, 1540271924658180097, 1, '下列操作方法能用来淡化海水的是', '[{\"Tag\":\"A\",\"Value\":\"沉淀法\"},{\"Tag\":\"B\",\"Value\":\"过滤法\"},{\"Tag\":\"C\",\"Value\":\"多级闪急蒸馏法\"},{\"Tag\":\"D\",\"Value\":\"电解法\"}]', 'C', '沉淀法、过滤法只能除去水中的难溶性杂质；电解水时水分子受到破坏，生成氢气和氧气。只有蒸馏法才能将水中溶有的盐类除去，成为纯净水，从而将海水淡化，选C。', 4.0, 2, '', '2022-06-23 17:39:51', 'Admin', '2022-06-29 10:38:56', 'Admin');
INSERT INTO `exam_question` VALUES (1542009421641682945, 0, 1540271986272505857, 1540271878395006976, 2, '以下哪些诗句是静夜思的？', '[{\"Tag\":\"A\",\"Value\":\"床前明月光\"},{\"Tag\":\"B\",\"Value\":\"夜来风雨声\"},{\"Tag\":\"C\",\"Value\":\"举头望明月\"},{\"Tag\":\"D\",\"Value\":\"花落有多少\"}]', 'A,C', '床前明月光，疑是地上霜。举头望明月，低头思故乡。', 20.0, 3, '', '2022-06-29 12:57:50', 'Admin', '2022-06-29 12:58:31', 'Admin');
INSERT INTO `exam_question` VALUES (1542011019159801857, 0, 1540271986272505857, 1540271878395006976, 3, '静夜思的作者是唐代的李白', '[{\"Tag\":\"A\",\"Value\":\"对\"},{\"Tag\":\"B\",\"Value\":\"错\"}]', '对', '李白的静夜思', 15.0, 1, '', '2022-06-29 13:04:11', 'Admin', '0001-01-01 00:00:00', NULL);
INSERT INTO `exam_question` VALUES (1542012282421252097, 0, 1540271986272505857, 1540271924658180097, 5, '刚刚有9本书，爸爸又给他买了5本，小明借去2本，剩下还有几本书？', '[]', '9+5-2=12', '9+5-2=12', 8.0, 5, '', '2022-06-29 13:09:12', 'Admin', '0001-01-01 00:00:00', NULL);
INSERT INTO `exam_question` VALUES (1542072551876988929, 0, 1540272019071963137, 1540271878395006976, 4, '（______），曲项向天歌。（_______），红掌拨清波。', '[]', '[{\"name\":\"鹅鹅鹅\",\"score\":10},{\"name\":\"白毛浮绿水\",\"score\":10}]', '咏鹅', 20.0, 4, '', '2022-06-29 17:08:41', 'Admin', '2022-06-29 17:20:05', 'Admin');
COMMIT;

