-- ----------------------------
-- Table structure for sys_file_column
-- ----------------------------
DROP TABLE IF EXISTS `sys_file_column`;
CREATE TABLE `sys_file_column` (
  `Id` bigint(20) NOT NULL COMMENT '唯一编号',
  `ParentId` bigint(20) NOT NULL DEFAULT '0' COMMENT '父编号',
  `ParentIdList` varchar(128) NOT NULL COMMENT '父编号集合',
  `Type` int(11) NOT NULL DEFAULT '0' COMMENT '类型 图片类型分类 0=本地 1=云端',
  `Layer` int(11) NOT NULL DEFAULT '1' COMMENT '级别',
  `Sort` int(11) DEFAULT NULL COMMENT '排序',
  `Name` varchar(50) NOT NULL COMMENT '栏目名称',
  `EnName` varchar(128) NOT NULL COMMENT '英文名称 文件夹名称',
  `CreateTime` datetime DEFAULT NULL COMMENT '添加时间',
  `CreateUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `UpdateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `UpdateUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `TenantId` bigint(50) NOT NULL DEFAULT '0' COMMENT '租户编号',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='资源栏目表 ';

-- ----------------------------
-- Table structure for sys_file_info
-- ----------------------------
DROP TABLE IF EXISTS `sys_file_info`;
CREATE TABLE `sys_file_info` (
  `Id` bigint(20) NOT NULL COMMENT '唯一编号',
  `ColumnId` bigint(20) NOT NULL DEFAULT '0' COMMENT '所属栏目',
  `Name` varchar(100) NOT NULL COMMENT '文件名称',
  `FileUrl` varchar(128) DEFAULT NULL COMMENT '文件地址',
  `FileType` varchar(32) NOT NULL COMMENT '文件类型',
  `FileSize` bigint(20) NOT NULL COMMENT '文件大小',
  `ImgSmall` varchar(128) DEFAULT NULL COMMENT '图片缩略图',
  `Sort` int(11) NOT NULL DEFAULT '1' COMMENT '排序',
  `IsDel` bit(1) DEFAULT NULL COMMENT '是否删除',
  `CreateTime` datetime DEFAULT NULL COMMENT '添加时间',
  `CreateUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `UpdateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `UpdateUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `TenantId` bigint(50) NOT NULL DEFAULT '0' COMMENT '租户编号',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='资源文件信息表 ';

-- ----------------------------
-- Table structure for sys_log
-- ----------------------------
DROP TABLE IF EXISTS `sys_log`;
CREATE TABLE `sys_log` (
  `Id` bigint(20) NOT NULL,
  `Level` varchar(20) DEFAULT NULL COMMENT '级别',
  `LogType` int(11) NOT NULL COMMENT '日志类型  1=登录  2=操作',
  `Module` varchar(100) DEFAULT NULL COMMENT '操作模块',
  `OperateType` varchar(20) DEFAULT NULL COMMENT '操作类型:例如添加、修改',
  `Method` varchar(10) DEFAULT NULL COMMENT '提交类型：get/post/delete',
  `OperateUser` varchar(30) DEFAULT NULL COMMENT '操作人',
  `IP` varchar(50) DEFAULT NULL COMMENT 'IP',
  `Parameters` longtext COMMENT '请求参数',
  `Address` varchar(500) DEFAULT NULL COMMENT '操作地址',
  `Status` bit(1) NOT NULL DEFAULT b'1' COMMENT '操作状态',
  `Message` varchar(2000) DEFAULT NULL COMMENT '详细信息',
  `ReturnValue` longtext COMMENT '返回结果',
  `OperateTime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '操作时间',
  `Browser` varchar(1000) DEFAULT NULL COMMENT '浏览器信息',
  `ExecutionDuration` int(11) NOT NULL DEFAULT '0' COMMENT '执行时长',
  `TenantId` bigint(50) NOT NULL DEFAULT '0' COMMENT '租户编号',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='登录日志\r\n操作日志\r\n任务日志';

