-- ----------------------------
-- Table structure for sys_menu
-- ----------------------------
DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu` (
  `Id` bigint(20) NOT NULL COMMENT '唯一编号',
  `Name` varchar(30) NOT NULL COMMENT '菜单名称',
  `ParentId` bigint(20) DEFAULT NULL COMMENT '父节点',
  `ParentIdList` varchar(200) DEFAULT NULL COMMENT '父节点集合组',
  `Code` varchar(30) DEFAULT NULL COMMENT '权限标识',
  `Layer` int(11) NOT NULL DEFAULT '1' COMMENT '菜单层级',
  `Urls` varchar(100) DEFAULT NULL COMMENT '路由地址',
  `Redirect` varchar(100) DEFAULT NULL COMMENT '重定向',
  `VuePath` varchar(100) DEFAULT NULL COMMENT 'Vue文件路径',
  `Icon` varchar(50) DEFAULT NULL COMMENT '菜单图标',
  `Active` varchar(200) DEFAULT NULL COMMENT '菜单高亮',
  `Color` varchar(20) DEFAULT NULL COMMENT '颜色',
  `Sort` int(11) NOT NULL DEFAULT '1' COMMENT '排序',
  `Fullpage` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否全屏',
  `Status` bit(1) NOT NULL DEFAULT b'1' COMMENT '状态',
  `IsDel` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `Types` varchar(20) NOT NULL DEFAULT '1' COMMENT '菜单类型',
  `Api` varchar(2000) DEFAULT NULL COMMENT '接口权限',
  `CreateTime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CreateUser` varchar(20) DEFAULT NULL COMMENT '创建人',
  `UpdateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `UpdateUser` varchar(20) DEFAULT NULL COMMENT '修改人',
  `TenantId` bigint(20) NOT NULL DEFAULT '0' COMMENT '租户编号',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='资源菜单表';

