-- ----------------------------
-- Table structure for sys_message
-- ----------------------------
DROP TABLE IF EXISTS `sys_message`;
CREATE TABLE `sys_message` (
  `Id` bigint(20) NOT NULL COMMENT '唯一编号',
  `ColumnId` bigint(20) NOT NULL DEFAULT '0' COMMENT '栏目Id',
  `Types` int(11) NOT NULL DEFAULT '1' COMMENT '类型',
  `Title` varchar(64) DEFAULT NULL COMMENT '留言标题',
  `Email` varchar(64) DEFAULT NULL COMMENT '邮箱信息',
  `Mobile` varchar(32) DEFAULT NULL COMMENT '手机号码',
  `Tags` varchar(128) DEFAULT NULL COMMENT '留言标签',
  `Summary` varchar(1024) DEFAULT NULL COMMENT '留言内容',
  `IsRead` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否已读',
  `IsDelete` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `UserId` bigint(20) NOT NULL DEFAULT '0' COMMENT '用户编号',
  `UserName` varchar(32) DEFAULT NULL COMMENT '用户姓名',
  `CreateTime` datetime NOT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '添加时间',
  `CreateUser` varchar(32) DEFAULT NULL COMMENT '添加人',
  `UpdateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `UpdateUser` varchar(32) DEFAULT NULL COMMENT '修改人',
  `TenantId` bigint(20) NOT NULL DEFAULT '0' COMMENT '租户编号',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='留言消息表';

