-- ----------------------------
-- Table structure for sys_notice
-- ----------------------------
DROP TABLE IF EXISTS `sys_notice`;
CREATE TABLE `sys_notice` (
  `Id` bigint(50) NOT NULL DEFAULT '0' COMMENT '唯一编号',
  `TenantId` bigint(20) DEFAULT NULL,
  `SendUserId` bigint(50) NOT NULL DEFAULT '0' COMMENT '发送人编号',
  `AcceptUserIds` varchar(2000) NOT NULL DEFAULT '0' COMMENT '接收人编号(0=全员)',
  `Title` varchar(255) NOT NULL COMMENT '通知标题',
  `Content` longtext COMMENT '通知内容',
  `Files` varchar(900) DEFAULT NULL COMMENT '附件内容支持多个',
  `Status` int(11) NOT NULL DEFAULT '0' COMMENT '1=草稿2=存档3=删除',
  `IsSend` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否为发送邮件',
  `CreateTime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CreateUser` varchar(255) DEFAULT NULL COMMENT '创建人',
  `UpdateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `UpdateUser` varchar(255) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='通知模块';

