  `Id` bigint(50) NOT NULL DEFAULT '0' COMMENT '唯一编号',
  `NoticeId` bigint(50) NOT NULL DEFAULT '0' COMMENT '通知编号',
  `UserId` bigint(50) NOT NULL DEFAULT '0' COMMENT '用户编号',
  `IsRead` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否已读',
  `CreateTime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CreateUser` varchar(255) DEFAULT NULL COMMENT '创建人',
  `TenantId` bigint(50) NOT NULL DEFAULT '0' COMMENT '租户编号',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='通知已读模块';

-- ----------------------------
-- Table structure for sys_organize
-- ----------------------------
DROP TABLE IF EXISTS `sys_organize`;
CREATE TABLE `sys_organize` (
  `Id` bigint(20) NOT NULL COMMENT '唯一编号',
  `ParentId` bigint(20) NOT NULL COMMENT '父节点',
  `Name` varchar(30) NOT NULL COMMENT '部门名称',
  `Number` varchar(30) DEFAULT NULL COMMENT '机构编码',
  `ParentIdList` varchar(500) DEFAULT NULL COMMENT '父节点集合',
  `Layer` int(11) NOT NULL DEFAULT '0' COMMENT '部门层级',
  `Sort` int(11) NOT NULL DEFAULT '1' COMMENT '排序',
  `Status` bit(1) NOT NULL DEFAULT b'1' COMMENT '状态',
  `IsDel` bit(1) NOT NULL DEFAULT b'0' COMMENT '删除状态',
  `LeaderUser` varchar(20) DEFAULT NULL COMMENT '部门负责人',
  `LeaderMobile` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `LeaderEmail` varchar(50) DEFAULT NULL COMMENT '联系邮箱',
  `CreateTime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CreateUser` varchar(20) DEFAULT NULL COMMENT '创建人',
  `UpdateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `UpdateUser` varchar(20) DEFAULT NULL COMMENT '修改人',
  `TenantId` bigint(50) NOT NULL DEFAULT '0' COMMENT '租户编号',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='组织机构表';

